import React from 'react';
import CorporateContent from '../components/corporate';
import Link from "next/link";
import styled from "styled-components";
import Banner from "../components/hero";

import { gql, useQuery } from '@apollo/client'

const query = gql`
query{  
  corporatePage{
    hero{
      title
      subTitle
      background{
        url
      }
    }
  }
}
`

const SloganButton = styled("button")`
background: #A02167;
box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.25);
border-radius: 5px;
padding: 5px 20px;
line-height: 19px;
text-align: center;
color: #ffffff;
border-color: transparent;
font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
text-align: center;
`;

const children =
    <Link href="/signup/corporate">
        <SloganButton>Sign up for your company</SloganButton>
    </Link>

const corporate = () => {
    const { data, loading } = useQuery(query)
    if (loading)
        return <Loading/>
    return (
        <>
            <Banner hero={data.corporatePage.hero} children={children}/>
            <CorporateContent />;
        </>
    )
}


export default corporate;
